import React, { useState, useEffect } from "react";
import axios from "axios";
import { ArrowDown, ArrowUp,} from "../../common/icons/icons";
import { Link, NavLink } from "react-router-dom";
import { useSelector } from "react-redux";

const contractEmployee = () => {
  const [users, setUsers] = useState([]);

  useEffect(() => {
    getUsers();
  }, []);

  const getUsers = async () => {
    const response = await axios.get("http://localhost:5000/users");
    setUsers(response.data);
  };


  return (
    <div>
      <div className="div-table">
        <div className="div-table-options">
          <NavLink className="table-options" to="/adduser">Dodaj użytkownika</NavLink>
        </div>
        <table className="employee-table">
          <thead>
            <tr className="employee-tr">
              <th>Imie Nazwisko</th>
              <th>Stanowisko</th>
              <th>Status</th>
              <th>Email</th>
              <th>Doświadczenie</th>
              <th className="employee-setting">Opcje</th>
            </tr>
          </thead>
          <tbody>
            {users.map((user, index) => (
            <React.Fragment key={user.id}>
            <tr key={user.uuid} className="employee-tr" onClick={() => handleRowClick(index)}>
               <td className="employee-profile td-employee">
                </td>
                  <td className="td-employee">
                  {user.profile && user.profile.contracts[0]  ? (user.profile.contracts[0].position ) : ("Brak danych" )}
                  </td>
                  <td className="td-employee">
                    {user.status == true ? ("Aktywny") : ("Nieaktwyny")}
                  </td>
                  <td className="td-employee">{user.email}</td>
                  <td className="td-employee">1rok</td>
                  <td className="td-employee employee-setting">
                  </td>
                </tr>
              </React.Fragment>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
};

export default contractEmployee;

